INSERT INTO `events` (`event_id`,`title`,`location`,`description`,`start_date`,`end_date`,`departure`,`what_to_bring`,`where_to_stay`,`age_requirements`,`health_requirements`) VALUES 
 (2,'Wildfires in Bastrop TX','Bastrop TX','As of 9/15, Approx. 1600 homes have been destroyed by these fires. \r\nWe have the opportunity to serve these wonderful people by helping to sift through the ashes to find items tied to memory, jewelry, china, etc. \r\nThis is the first response where we\\\'ve been able to allow volunteers to volunteer as their schedules allow. If you can give one day or twenty- you are welcome and appreciated.',1315803600,1318395600,'Your Home','Thick soled shoes, jeans or pants suggested, air mattress/bedding, towels, personal hygiene, sunblock, insect repellent, modest clothing, cordless drills, tetanus shot strongly advised','Local Austin Church','Minimum age 13- with a parent up to 16. ','We will be sifting ash- with masks that will make you very hot- so if you overheat easily or have a lung condition or trouble breathing- this is not the trip for you.'),
 (3,'Joplin Tornado Clean-up','Joplin, MO','We will be assisting with cleanup',1307941200,1308373200,'Mustang Creek Community Church','Personal toiletries, change of clothes','Madison, KS','Minimum 18 years of age','No health problems'),
 (5,'Forney Tornado Relief','Forney, Texas','9AM Saturday April 14 for clean up and canvassing. ',1333429200,1334379600,'Mustang Creek Community Church ',' ','Mustang Creek Community Church ','  ',' '),
 (6,'Lancaster Tornado Relief','643 West Wintergreen','We have moved the site closer to the affected homes. Please join us beginning at 8:30AM each day.\r\n\r\nPlease call 972.293.5590 for more information. ',1333602000,1334034000,' ',' ',' ',' Under 14 on campus with parent only; 14-17 in the field with a parent or legal guardian.',' '),
 (7,'Royce City Tornado Response','Home Base: 13851 FM 548 Forney TX 75126','We will be assisting in the Royce City area with clean up and searching for personal effects. Volunteer intake will begin at 9AM each day with the first orientation and these orientations will continue throughout the day. Please contact us for any additional information you may require.',1334034000,1334379600,' ',' ',' ','Under 14 will not be allowed in the field only at home base and distribution with a guardian. 14-17 with a parent or guardian. ',' ');
